sc_cat_item_producer.script:
var Divider                 = "\n\n--------------------------------------------------";
var PolicyWho               = "\nWho needs permission(s):\t";
var PolicyWhat              = "\nWhat permissions needed:\t"; 
var PolicyApprovalObtained  = "\nApproval obtained?:\t\t"; 
var PolicyDepartmentManager = "\nDepartment manager:\t\t"; 

var notes = Divider;

notes += PolicyWho               + producer.policystat_permission_who.getDisplayValue();
notes += PolicyWhat              + producer.policystat_permission_what.getDisplayValue();
notes += PolicyApprovalObtained  + producer.policystat_permission_obtained.getDisplayValue();
notes += PolicyDepartmentManager + producer.department_manager.getDisplayValue();

// Add the request specific fields to the customer notes
current.description += notes;

// Set the default assignment group to Regulatory
current.assignment_group.setDisplayValue('Regulatory-All');

producer.redirect = "catalog_home.do?sysparm_catalog=95812d86134c0b00d80074c66144b0b3";
